import React from 'react'
import styled from 'styled-components'
import {AiOutlineUser} from 'react-icons/ai';
const DashboardScreen = () => {
  return (
    <Wrapper>
    <div className='dashboxes'>
      <div>
        <AiOutlineUser/>
        <p>Total Users</p>
        <h4>1,000</h4>
        
      </div>
      <div>2</div>
      <div>3</div>
      <div>4</div>
      <div>5</div>
      <div>6</div>
    </div>
    </Wrapper>
   
  )
}

export default DashboardScreen


const Wrapper = styled.div`
width: 90%;
margin: auto;
background: grey;
.dashboxes {
  width: 60%;
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;
}
.dashboxes div {
  width: 250px;
  height: 200px;
  background: white;
  box-shadow: rgba(0, 0, 0, 0.35) 0px 5px 15px;
  border-radius: 5px;
  margin: 10px;
}

`
